            function mDist(a,b){
                var R=6371000;
                var dLat=(b[0]-a[0])*Math.PI/180;
                var dLon=(b[1]-a[1])*Math.PI/180;
                var lat1=a[0]*Math.PI/180;
                var lat2=b[0]*Math.PI/180;
                var s=Math.sin(dLat/2)**2 + Math.cos(lat1)*Math.cos(lat2)*Math.sin(dLon/2)**2;
                return R*2*Math.atan2(Math.sqrt(s), Math.sqrt(1-s));
            }

            function nearest(){
                if(!navigator.geolocation) return alert("Геолокация не поддерживается");
                if(!STREETS.length) return alert("Нет данных об улицах");

                navigator.geolocation.getCurrentPosition(function(pos){
                    var u=[pos.coords.latitude, pos.coords.longitude];
                    var best=-1, bestD=1e12;

                    for(let i=0;i<STREETS.length;i++){
                        let s=STREETS[i];
                        if(!s.mid) continue;
                        let d=mDist(u, s.mid);
                        if(d<bestD){ bestD=d; best=i; }
                    }

                    if(best<0) return alert("Не найдена ближайшая улица");

                    let s=STREETS[best];
                    L.polyline(s.coords, {color:"#1f78b4",weight:14,opacity:0.75}).addTo(MAP);

                    L.circleMarker(u,{radius:6,color:"#333",fillColor:"#fff",weight:2})
                        .addTo(MAP)
                        .bindPopup("Вы здесь").openPopup();
                    
                    MAP.flyTo(s.mid, 16);
                    var dLat = (u[0] - t[0]) * 111.32; // км на градус широты
                    var dLon = (u[1] - t[1]) * 40075 * Math.cos(u[0] * Math.PI/180) / 360;
                    var distKm = Math.sqrt(dLat*dLat + dLon*dLon);

                    // примерное время ходьбы
                    var walkMinutes = Math.round((distKm / 5) * 60); // скорость 5 км/ч
                    L.popup().setLatLng(s.mid)
                        .setContent("Ближайшая улица: <b>"+s.name+"</b><br>Расстояние: "+Math.round(bestD)+" м" + "<br>Пешком примерно: " + walkMinutes + " мин")
                        .openOn(MAP);

                },function(err){
                    alert("Ошибка геопозиции: "+err.message);
                },{
                    enableHighAccuracy:true
                });
            }

            var btn=document.createElement("button");
            btn.textContent="Показать ближайшую улицу ко мне";
            btn.style.position="absolute";
            btn.style.top="10px";
            btn.style.left="50%";
            btn.style.transform="translateX(-50%)";
            btn.style.padding="8px 12px";
            btn.style.background="white";
            btn.style.border="1px solid #888";
            btn.style.borderRadius="6px";
            btn.style.zIndex=99999;
            btn.onclick=nearest;
            document.body.appendChild(btn);
        });
        </script>
